baseProperty.styleDataNew:
/*id是easyui控件的id
//domId是包裹easyui控件的外层div的id*/

/*所有边框消失*/
#domId .layout-panel-north .panel-body{
    border:0;
}
#domId .layout-panel-west .panel-body{
    border:0;
}
#domId .layout-panel-south .panel-body{
    border:0;
}
#domId .layout-panel-east .panel-body{
    border:0;
}
#domId .layout-panel-center .panel-body{
    border:0;
}

